How I Met Your Mother is an Emmy Award winning American sitcom that premiered on CBS on September 19, 2005. The show was created by Craig Thomas and Carter Bays. As a framing device, the main character, Ted Mosby (Josh Radnor), in the year 2030 recounts to his son and daughter the events that led to his meeting their mother, which explains the title and allows for a narration in the past tense. How I Met Your Mother's other main characters are Marshall Eriksen (Jason Segel), Robin Scherbatsky (Cobie Smulders), Barney Stinson (Neil Patrick Harris), and Lily Aldrin (Alyson Hannigan).
